import React from 'react';
import { Email, Phone } from '@mui/icons-material';

const ContactComponent = () => {
    return (
        <div>
            <div>
                <Email />
                <a href="mailto:siddharthrupwate@gmail.com">siddharthrupwate@gmail.com</a>
            </div>
            <div>
                <Phone />
                <a href="tel:+918652503057">+91 8652503057</a>
            </div>
        </div>
    );
};

export default ContactComponent;
